webpackJsonp([0x8315f4dc2ff8e000],{"./node_modules/json-loader/index.js!./.cache/json/mathematics-converting-units-minutes-to-hours.json":function(n,t){n.exports={data:{markdownRemark:{html:'<h2>Converting Units Minutes to Hours</h2>\n<p>A minute is defined as one sixtieth of an hour. Conversion between minutes and hours is thus given by</p>\n<pre><code>t<sub>h</sub> = t<sub>min</sub> / 60\n\nt<sub>min</sub> = t<sub>h</sub> * 60\n</code></pre>\n<p>where t<sub>min</sub> is the time in minutes and t<sub>h</sub> is the time in hours.</p>\n<p>The symbols for time in minutes and hours are <strong>min</strong> and <strong>h</strong> respectively (The International System of Units, 8th edition, <a href="https://www.bipm.org/utils/common/pdf/si_brochure_8_en.pdf">Chapter 4: Units outside the SI</a>).</p>\n<h3>Examples</h3>\n<p>Converting from time in minutes to time in hours:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>90 minutes = (90 / 60) hours = 1.5 hours</code></pre>\n      </div>\n<p>Converting from time in hours to time in minutes:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>24 hours = (24 * 60) minutes = 1440 minutes</code></pre>\n      </div>',fields:{slug:"/mathematics/converting-units-minutes-to-hours/"},frontmatter:{title:"Converting Units Minutes to Hours"}}},pathContext:{slug:"/mathematics/converting-units-minutes-to-hours/"}}}});
